import React, { useState, useContext } from 'react';
import { Container, Form, Button, Card, Alert } from 'react-bootstrap';
import { useNavigate, Link } from 'react-router-dom';
import { authAPI } from '../services/api';
import { AuthContext } from '../context/AuthContext';
import Swal from 'sweetalert2';
import './Auth.css';

function Login() {
  const navigate = useNavigate();
  const { loginUser } = useContext(AuthContext);
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    try {
      const response = await authAPI.login({ email, password });
      loginUser(response.data.user, response.data.token);
      Swal.fire('Success', 'Login successful', 'success').then(() => {
        navigate('/dashboard');
      });
    } catch (err) {
      const message = err.response?.data?.message || 'Login failed';
      setError(message);
      Swal.fire('Error', message, 'error');
    } finally {
      setLoading(false);
    }
  };

  const handleGoogle = () => {
    // Redirect to backend Google OAuth endpoint
    window.location.href = '/api/auth/google';
  };

  return (
    <div className="auth-page">
      <div className="auth-center">
        <div className="auth-illustration">
          <h2>CaliberWatch</h2>
          <p>Discover curated timepieces and manage your collection.</p>
        </div>

        <div className="auth-card">
          <div className="auth-header">
            <div className="auth-logo">CW</div>
            <div>
              <h3 className="auth-title">Welcome Back</h3>
              <div className="auth-sub">Sign in to continue to CaliberWatch</div>
            </div>
          </div>

          <div>
            <div className="social-btn">
              <button type="button" className="btn-google" onClick={handleGoogle}>
                <img src="https://www.gstatic.com/firebasejs/ui/2.0.0/images/auth/google.svg" alt="Google" />
                Continue with Google
              </button>
            </div>

            <div className="auth-divider">or</div>

            <Card>
              <Card.Body>
                {error && <Alert variant="danger">{error}</Alert>}

                <Form onSubmit={handleSubmit}>
                  <Form.Group className="mb-3">
                    <Form.Label className="form-label">Email</Form.Label>
                    <Form.Control
                      type="email"
                      placeholder="Enter email"
                      value={email}
                      onChange={(e) => setEmail(e.target.value)}
                      required
                    />
                  </Form.Group>

                  <Form.Group className="mb-3">
                    <Form.Label className="form-label">Password</Form.Label>
                    <Form.Control
                      type="password"
                      placeholder="Enter password"
                      value={password}
                      onChange={(e) => setPassword(e.target.value)}
                      required
                    />
                  </Form.Group>

                  <Button className="btn-rose" type="submit" disabled={loading}>
                    {loading ? 'Logging in...' : 'Login'}
                  </Button>
                </Form>
              </Card.Body>
            </Card>

            <div style={{ marginTop: 12 }} className="text-center">
              <p>Don't have an account?</p>
              <Link to="/register" className="btn btn-outline-light w-100">
                Create account
              </Link>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Login;
